import React, { useEffect, useState } from 'react';
import { products } from './Local';

function FilterBox() {
  const [items, setItems] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [newItem, setNewItem] = useState({ id: '', name: '', color: '', brand: '', price: '' });

  const sortAscending = () => {
    const sortedItems = [...items].sort((a, b) => a.id - b.id);
    setItems(sortedItems);
  };

  const sortDescending = () => {
    const sortedItems = [...items].sort((a, b) => b.id - a.id);
    setItems(sortedItems);
  };

  const handleAddItem = () => {
    setItems([...items, { ...newItem, id: Date.now() }]); // Use timestamp for unique ID
    setNewItem({ id: '', name: '', color: '', brand: '', price: '' });
  };

  const handleDeleteItem = (id) => {
    setItems(items.filter(item => item.id !== id));
  };

  const handleModifyItem = (id) => {
    const itemToModify = items.find(item => item.id === id);
    setNewItem(itemToModify);
    handleDeleteItem(id);
  };

  const filteredItems = items.filter(item => 
    item.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  useEffect(() => {
    setItems(products);
  }, []);

  return (
    <div style={styles.app}>
      <div style={styles.filter}>
        <input 
          type="text" 
          placeholder="Search..." 
          value={searchTerm} 
          onChange={(e) => setSearchTerm(e.target.value)} 
          style={styles.input} 
        />
        <button style={styles.button} onClick={sortAscending}>Ascending</button>
        <button style={styles.button} onClick={sortDescending}>Descending</button>
        <input 
          type="text" 
          placeholder="Name" 
          value={newItem.name} 
          onChange={(e) => setNewItem({ ...newItem, name: e.target.value })} 
          style={styles.input} 
        />
        <input 
          type="text" 
          placeholder="Color" 
          value={newItem.color} 
          onChange={(e) => setNewItem({ ...newItem, color: e.target.value })} 
          style={styles.input} 
        />
        <input 
          type="text" 
          placeholder="Brand" 
          value={newItem.brand} 
          onChange={(e) => setNewItem({ ...newItem, brand: e.target.value })} 
          style={styles.input} 
        />
        <input 
          type="text" 
          placeholder="Price" 
          value={newItem.price} 
          onChange={(e) => setNewItem({ ...newItem, price: e.target.value })} 
          style={styles.input} 
        />
        <button style={styles.button} onClick={handleAddItem}>Add Item</button>
      </div>
      <div style={styles.itemList}>
        <ul style={styles.ul}>
          {filteredItems.map((item) => (
            <li key={item.id} style={styles.li}>
              <h3>{item.id}</h3>
              <h3>{item.name}</h3>
              <p>{item.color}</p>
              <p>{item.brand}</p>
              <p><strong>{item.price}</strong></p>
              <button style={styles.button} onClick={() => handleModifyItem(item.id)}>Modify</button>
              <button style={styles.button} onClick={() => handleDeleteItem(item.id)}>Delete</button>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

const styles = {
  app: {
    display: 'flex',
    height: '100vh',
    margin: 0,
    fontFamily: 'Arial, sans-serif'
  },
  filter: {
    width: '20%',
    backgroundColor: '#f4f4f4',
    padding: '20px',
    boxShadow: '2px 0 5px rgba(0,0,0,0.1)'
  },
  itemList: {
    width: '80%',
    padding: '20px'
  },
  button: {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: '#fff',
    border: 'none',
    cursor: 'pointer',
    fontSize: '16px',
    borderRadius: '5px',
    margin: '5px'
  },
  input: {
    padding: '10px',
    margin: '5px',
    border: '1px solid #ddd',
    borderRadius: '5px',
    width: '100%'
  },
  ul: {
    listStyleType: 'none',
    padding: 0
  },
  li: {
    padding: '10px',
    borderBottom: '1px solid #ddd'
  }
};

export default FilterBox;
